import React, { useState } from 'react';
import '../App.css';

export default function Homepage() {
  const [state, setState] = useState("");

  function getRandomInt(max) {
    return Math.floor(Math.random() * max);
  }
  const arr = ['rock','paper','scissors'];

  return (
    <div className="bodyStyle">
      <h1 className="wText">Rock Paper Scissors</h1>
      <article>
        <div>
          <h2 className="wText">Player</h2>
          <h2 className="wText">Score</h2>
          <h2 className="wText">Computer</h2>
        </div>
        <span>{state}</span>
      </article>
      <main>
        <div>
          <button onClick={() => setState("rock") }>rock</button>
          <button onClick={() => setState("paper") }>paper</button>
          <button onClick={() => setState("scissors") }>scissors</button>
        </div>
      </main>
      <footer>
        <div>
          <h2>HighScore</h2>
        </div>
      </footer>
    </div>
  )
}
